const NotFound = () => {
    return (
        <Fragment>
            <h1 className="x-large text-primary">
                <i className="fas exclamation-triangle"></i> Page Not Found
            </h1>
            <p>Sorry,this page does not exist</p>
        </Fragment>
    )
}

export default NotFound
